INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AME', 'STOCK', 'AMETEK, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'AMETEK, Inc. É um fornecedor global de soluções de tecnologia industrial que atendem a um conjunto diversificado de nichos de mercado. Os segmentos da Companhia incluem Instrumentos Eletrônicos (EIG) e Eletromecânicos (EMG). O segmento EIG projeta e fabrica avançados instrumentos analíticos, de teste e de medição para os mercados de processo, aeroespacial, médico, pesquisa, energia e industrial. O segmento EIG fornece à indústria aeroespacial sensores de aeronaves e motores, sistemas de monitoramento, sistemas de computação embarcados, fontes de alimentação, sistemas de medição de combustível e fluido e sistemas de aquisição de dados. O segmento EMG fornece soluções de controle de movimento de precisão, componentes e dispositivos médicos altamente projetados, sistemas de gerenciamento térmico, metais especiais e interconexões elétricas. O segmento EMG fornece metais em pó de alta pureza, tiras e folhas, metais folheados especiais e compósitos de matriz metálica. Os mercados finais do s', 'Berwyn, PA, United States', 21500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDN', 'STOCK', 'Brandywine Realty Trust', 'NYQ', 'Real Estate', 'REIT - Office', 'Brandywine Realty Trust is a self-administered and self-managed real estate investment trust (REIT). It is engaged in the acquisition, development, redevelopment, ownership, management, and operation of a portfolio of office, life science/lab, residential and mixed-use properties. It owns its assets and conducts its operations through Brandywine Operating Partnership, L.P. The Company operates through four segments: Philadelphia Central Business District, Pennsylvania Suburbs, Austin, Texas, and Other. The Philadelphia CBD segment includes properties located in the City of Philadelphia, Pennsylvania. The Pennsylvania Suburbs segment includes properties in Chester, Delaware and Montgomery counties in the Philadelphia suburbs. The Austin, Texas segment includes properties in the City of Austin, Texas. The Other segment includes properties in Washington, D.C., Northern Virginia, Southern Maryland, Camden County, New Jersey and New Castle County, Delaware.', 'Philadelphia, PA, United States', 285);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FRO', 'STOCK', 'Frontline plc', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'FRONTLINE PLC is a Cyprus-based company primarily operating in the transportation sector. The Company''s main focus is on seaborne transportation of crude oil and refined products. The Company owns and operates a fleet consisting of multiple VLCC, Suezmax and LR2 / Aframax tankers intended for freight of oil and cargo. The Company operates worldwide.', 'Limassol, , Cyprus', 85);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTM', 'STOCK', 'Bitcoin Depot Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'Bitcoin Depot Inc. is a Bitcoin ATM (BTM) operator and fintech company. The Company provides its users with the means of converting cash into cryptocurrency, which users can deploy in the payments, spending and investing space. Its offerings include approximately 8,500 BTMs in retailer locations throughout the United States, Canada, and Puerto Rico, its BDCheckout product, which is accepted at approximately 7,600 retail locations, and its mobile app. Bitcoin Depot''s process is to convert cash into Bitcoin via its BTMs and the mobile app enables not only the users, but also the broader public, to access the digital financial system. The Company primarily purchases cryptocurrencies to sell to customers. It also offers a software solution to other BTM operators through its controlled subsidiary, BitAccess Inc. The Company''s diverse retail locations consist of convenience stores and gas station chains, pharmacies and grocers, and mall operators.', 'Atlanta, GA, United States', 126);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAR', 'STOCK', 'Darling Ingredients Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'Darling Ingredients Inc. É um desenvolvedor e produtor de ingredientes naturais sustentáveis a partir de bionutrientes comestíveis e não comestíveis, criando uma gama de ingredientes e soluções especiais personalizadas para clientes nas áreas farmacêutica, alimentar, pet food, ração animal, industrial, indústrias de combustíveis, bioenergia e fertilizantes. Seus segmentos incluem ingredientes de alimentação, ingredientes alimentares e ingredientes de combustível. O segmento de Ingredientes Alimentares inclui suas atividades globais relacionadas à coleta e processamento de subprodutos animais de carne bovina, aves e suínos na América do Norte, Europa e América do Sul em óleos não alimentares e refeições proteicas, entre outros. O segmento de Ingredientes Alimentares inclui suas atividades globais relacionadas à compra e processamento de chips de carne bovina e suína, peles de porco, peles de porco e peles de peixe em colágeno, entre outros. O segmento de Ingredientes de Combustível conv', 'Irving, TX, United States', 15500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CROX', 'STOCK', 'Crocs, Inc.', 'NMS', 'Consumer Cyclical', 'Footwear & Accessories', 'Crocs, Inc. is engaged in the design, development, worldwide marketing, distribution, and sale of casual lifestyle footwear and accessories for all. The Company''s brands include Crocs and HEYDUDE. The Crocs Brand''s collection contains Croslite material, a proprietary, molded footwear technology. It also uses Croslite material formulations in connection with material technologies used in its visible comfort collections, such as its LiteRide and Free Feel Technology products. The HEYDUDE Brand offers shoes with an iconic and versatile loafer silhouette with many wearing occasions that focus on casualization, comfort-led functionality and personalization. It sells its products in more than 80 countries, through wholesale and direct-to-consumer channels. Its wholesale channel includes domestic and international multi-brand retailers, e-tailers and others. Its direct-to-consumer channel includes Company-operated retail stores, Company-operated e-commerce sites and third-party marketplaces', 'Broomfield, CO, United States', 7910);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQH', 'STOCK', 'Equitable Holdings, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Equitable Holdings, Inc. is a financial services holding company, which comprised of complementary businesses, such as Equitable, AllianceBernstein and Equitable Advisors. Its segments include Individual Retirement, Group Retirement, Asset Management, Protection Solutions, Wealth Management, and Legacy. Its Individual Retirement segment provides individual variable annuity products. The Group Retirement segment offers tax-deferred investment and retirement services or products to plans sponsored by educational entities, municipalities and not-for-profit entities, as well as small and medium-sized businesses. The Asset Management segment provides diversified investment management and related services to a range of clients globally. The Wealth Management segment offers discretionary and non-discretionary investment advisory accounts, financial planning and advice, insurance, and annuity products. The Legacy segment primarily consists of the capital-intensive fixed-rate GMxB business.', 'New York, NY, United States', 8000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CF', 'STOCK', 'CF Industries Holdings, Inc.', 'NYQ', 'Basic Materials', 'Agricultural Inputs', 'A CF Industries Holdings, Inc. É um fabricante global de produtos de hidrogénio e azoto. A empresa está focada na descarbonização de sua rede de produção de amônia para permitir hidrogênio e nitrogênio com baixo teor de carbono para energia, fertilizantes, redução de emissões e outras atividades industriais. Os segmentos da empresa incluem amônia, ureia granular, UAN, AN e outros. O segmento de amônia produz amônia anidra (amônia), que é o produto base que fabrica (contendo 82% de nitrogênio e 18% de hidrogênio). O segmento de ureia granular produz ureia granular, que contém 46% de azoto. O segmento UAN produz solução de nitrato de amônio de ureia (UAN). Um segmento produz nitrato de amónio (AN). Outro segmento inclui principalmente produtos, como fluido de escape diesel (DEF), licor de ureia e ácido nítrico. Seus complexos de fabricação nos Estados Unidos, Canadá e Reino Unido, uma rede de armazenamento, transporte e distribuição na América do Norte, e capacidades logísticas permitem ', 'Northbrook, IL, United States', 2800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLND', 'STOCK', 'Blend Labs, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Blend Labs, Inc. is a digital origination platform for banks, credit unions, and mortgage lenders. The Company has built a cloud-based software platform and suite of products for financial services firms. From mortgages to consumer loans to deposit accounts, the Company helps financial institutions streamline workflows and deliver customer experiences. The Company has technology, data, and service providers on its software platform, including access to an extensive marketplace of insurance carriers and settlement agencies. The Company''s platform also includes Blend Builder, which gives its customers the ability to easily configure or build custom workflows from a pre-built set of components, all while leveraging existing infrastructure. Financial services firms can create custom solutions with Blend Builder, or choose from pre-built solutions for Mortgage and Consumer Banking, including Home Equity, Deposit Accounts, Credit Cards, Personal Lending, Auto Lending and more.', 'Novato, CA, United States', 540);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VFF', 'STOCK', 'Village Farms International, Inc.', 'NCM', 'Consumer Defensive', 'Farm Products', 'Village Farms International, Inc. is a vertically integrated supplier of plant-based consumer packaged goods in the cannabis and cannabidiol (CBD) categories in North America, the Netherlands, and selected markets internationally. Its segments include Produce, Cannabis-Canada, Cannabis-U.S., Clean Energy and Cannabis - Netherlands. Produce segment produces, markets and sells tomatoes, bell peppers and cucumbers. Cannabis-Canada produces and supplies cannabis products to be sold to other licensed providers and provincial governments across Canada and internationally. Cannabis-U.S. develops and sells CBD-based health and wellness products, including ingestible, edible and topical applications, across the United States. Clean Energy receives a royalty representing a portion of the natural gas that is sold to one customer pursuant to its long-term contract. Cannabis - Netherlands segment produces and supplies cannabis products in the Netherlands, supplying designated coffee shops.', 'Lake Mary, FL, United States', 1400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWI', 'STOCK', 'Armstrong World Industries, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'A Armstrong World Industries, Inc. Projeta, inova e fabrica soluções de sistema de teto e parede. A empresa fabrica e fabrica produtos feitos de vários materiais, incluindo fibra mineral, lã de fibra de vidro, metal, madeira, fibra de madeira, gesso reforçado com vidro e feltro. Também fabrica produtos de sistema de suspensão de teto (grade). Seu segmento de Fibra Mineral produz sistemas de fibra mineral suspensa e teto de fibra macia. Seus produtos oferecem vários atributos de desempenho, como controle acústico, proteção contra incêndio nominal e eficiência energética. Seu segmento de especialidades arquitetônicas produz, projeta e fontes tetos, paredes e fachadas para uso em ambientes comerciais. Seus produtos estão disponíveis em metal, feltro e madeira, além de várias cores, formas e desenhos. Vende produtos padrão, premium e personalizados. Ela também está envolvida na conceção e fabricação de resinas arquitetônicas e vidro criadas de forma sustentável para tetos, paredes e outras', 'Lancaster, PA, United States', 3700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRTO', 'STOCK', 'Criteo S.A.', 'NMS', 'Communication Services', 'Advertising Agencies', 'Criteo SA is a France-based company specializing in digital performance marketing. Its solution consists of the Criteo Engine, the Company''s data assets, access to inventory, and its advertiser and publisher platforms. The Criteo Engine consists of various machine learning algorithms, such as prediction, recommendation, bidding and creative algorithms and the global hardware and software infrastructure. The Criteo Engine delivers advertisements through multiple marketing channels and formats, including display advertising banners, native advertising banners and marketing messages delivered to opt-in e-mail addresses. Advertisements are delivered on all devices and screens, including Web browsers on desktops and laptops, mobile Web browsers on smart phones and tablets, as well as mobile applications. It operates in approximately 90 countries through a network of over 30 international offices located in Europe, the Americas and the Asia-Pacific region.', 'Paris, , France', 3507);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BJ', 'STOCK', 'BJ''s Wholesale Club Holdings, Inc.', 'NYQ', 'Consumer Defensive', 'Discount Stores', 'BJs Wholesale Club Holdings, Inc. is an operator of membership warehouse clubs concentrated primarily on the eastern half of the United States. The Company provides a wide assortment of fresh foods, produce, a full-service deli, fresh bakery, household essentials and gas. It also offers technology, home decor, apparel, seasonal items, among others. It groups its merchandise offerings into two divisions: perishables, grocery and sundries, and general merchandise and services. Perishables, grocery, and sundries consist of meat, produce, dairy, deli and frozen products, packaged foods, beverages, detergents, disinfectants, paper products, beauty care, adult and baby care, and pet foods. General merchandise and services consist of electronics, apparel, seasonal goods, small appliances, televisions, furniture, optical, tires and third-party gift cards. It offers specialty services, such as full-service optical centers, tire installation services, a propane tank filling service, and others.', 'Marlborough, MA, United States', 33000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLT', 'STOCK', 'Applied Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Applied Therapeutics, Inc. is a clinical-stage biopharmaceutical company engaged in the development of drug candidates against validated molecular targets in rare diseases. The Companys lead drug candidate, govorestat, is a central nervous system penetrant Aldose Reductase Inhibitor (ARI) for the treatment of CNS rare metabolic diseases, including classic galactosemia, sorbitol dehydrogenase (SORD) deficiency and phosphomannomutase 2 (PMM2)-congenital disorder glycosylation (CDG). The Company is also developing AT-001, an investigational, ARI developed as an oral therapy for the treatment of diabetic cardiomyopathy (DbCM). It has completed a Phase I/II clinical trial evaluating AT-001 in approximately 120 patients with type II diabetes. The Companys pipeline also includes AT-003, an ARI designed to cross through the back of the eye when dosed orally, and has demonstrated strong retinal penetrance, for the treatment of diabetic retinopathy (DR).', 'New York, NY, United States', 36);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWIN', 'STOCK', 'The Baldwin Insurance Group, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'The Baldwin Insurance Group, Inc. is an independent insurance distribution company. The Companys business is divided into three operating groups: Insurance Advisory Solutions (IAS), Underwriting, Capacity & Technology Solutions (UCTS) and Mainstreet Insurance Solutions (MIS). The IAS operating group provides commercial risk management, employee benefits and private risk management solutions for businesses and high-net-worth individuals, as well as their families. The UCTS operating group consists of two distinct businesses, its MGA platform (MSI) and its reinsurance brokerage business, Juniper Re. Through MSI, it manufactures proprietary, technology-enabled insurance products that are then distributed internally via risk advisors across its other operating groups and externally via select distribution partners. The MIS operating group offers personal insurance, commercial insurance and life and health solutions to individuals and businesses in their communities.', 'Tampa, FL, United States', 4000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BANC', 'STOCK', 'Banc of California, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banc of California, Inc. is a bank holding company for its subsidiary, Banc of California (the Bank), a California state-chartered bank. The Bank offers a broad range of loan and deposit products and services through 80 full-service branches located throughout California and in Denver, Colorado, and Durham, North Carolina, as well as through regional offices nationwide. The Bank also provides full-stack payment processing solutions through its subsidiary, Deepstack Technologies, LLC (Deepstack). The Bank is organized into four business groups, such as Community Banking, Specialty Banking, Deposit Services, and Payment Solutions. Specialty Banking is focused on serving clients in niche verticals by industry, including homeowner associations, venture banking, SBA lending, mortgage warehouse lending, media and entertainment and equipment finance. Deposit Services provide valuable services to clients in the Community and Specialty Banking groups.', 'Los Angeles, CA, United States', 1903);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AER', 'STOCK', 'AerCap Holdings N.V.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'AerCap Holdings N.V. is an Ireland-based company, which is primarily engaged in aviation leasing. It provides a range of assets for leasing, including narrowbody and widebody aircraft, regional jets, freighters, engines and helicopters. It provides 10 types of modern narrowbody and widebody cargo aircraft to over 20 customers around the world, including e-commerce, express delivery and general cargo operators. It is a lessor of spare engines, with over 1,000 engines, including engines owned and managed by Shannon Engine Support Ltd (SES), its joint venture with Safran Aircraft Engines, and over 150 customers. Its offer includes new and used commercial passenger and cargo aircraft, and helicopters, on operating lease from its existing fleet and order book. In addition, it offers aftermarket components, equipment and services through its materials business and the lease, purchase and financing of spare engines. Its portfolio consists of about 3,508 aircraft, engines and helicopters.', 'Dublin, , Ireland', 698);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDR', 'STOCK', 'Builders FirstSource, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Builders FirstSource, Inc. is a supplier of structural building products, value-added components and services to the professional market for single-family and multi-family construction and repair and remodeling. The Company provides customers an integrated homebuilding solution, offering manufacturing, supply, delivery, and installation of a full range of structural and related building products. The Company groups its building products and services into four product categories: Manufactured Products; Windows, Doors and Millwork; Specialty Building Products and Services, and Lumber and Lumber Sheet Goods. Its manufactured products are factory-built substitutes for job-site framing and include wood floor and roof trusses, wall panels and engineered wood. Its specialty building products and services consist of various products, including vinyl, composite and wood siding, exterior trim, metal studs, cement and insulation. The Company operates in approximately 43 states with 590 locations.', 'Irving, TX, United States', 29000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACB', 'STOCK', 'Aurora Cannabis Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aurora Cannabis Inc. is a Canada-based medical cannabis company. The Companys principal business lines are focused on the production, distribution and sale of cannabis and cannabis-derivative products in Canada and internationally, and the propagation of vegetables and ornamental plants in North America. Its segments include Canadian Cannabis and Plant Propagation. The Company''s adult-use brand portfolio includes Drift, San Rafael ''71, Daily Special, Tasty''s, Being and Greybeard. Its medical cannabis brands include MedReleaf, CanniMed, Aurora and Whistler Medical Marijuana Co, as well as international brands, Pedanios, Bidiol, IndiMed and CraftPlant. It also has a controlling interest in Bevo Farms Ltd., North America''s supplier of propagated vegetables and ornamental plants in North America. Its subsidiaries include Aurora Cannabis Enterprises Inc., Aurora Deutschland GmbH, TerraFarma Inc., Whistler Medical Marijuana Corporation, and Indica Industries Pty Ltd., among others.', 'Edmonton, AB, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCS', 'STOCK', 'Doximity, Inc.', 'NYQ', 'Healthcare', 'Health Information Services', 'Doximity, Inc. Fornece uma plataforma digital para os profissionais médicos dos Estados Unidos. Ele fornece uma plataforma on-line, que permite que médicos e outros profissionais de saúde colaborem com seus colegas, mantenham-se atualizados com as últimas notícias médicas e pesquisas e gerenciem suas carreiras. Oferece soluções de Marketing, Contratação e Produtividade para fabricantes farmacêuticos, sistemas de saúde, empresas de recrutamento médico e outras empresas de saúde. Suas soluções de marketing permitem que seus clientes farmacêuticos e de sistemas de saúde obtenham o conteúdo, serviços e conexões entre pares certos com os profissionais médicos certos através de uma variedade de módulos. Suas soluções de contratação fornecem recursos de recrutamento digital para sistemas de saúde e empresas de recrutamento médico. Suas Soluções de Produtividade incluem suas ferramentas de telesaúde, agendamento on-call e correspondência médica com suporte a inteligência artificial (IA) e são ', 'San Francisco, CA, United States', 830);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CE', 'STOCK', 'Celanese Corporation', 'NYQ', 'Basic Materials', 'Chemicals', 'A Celanese Corporation é uma empresa global de materiais químicos e especiais. A empresa é um produtor global de polímeros projetados que são usados em uma variedade de aplicações. Seus segmentos incluem materiais projetados e a cadeia de acetil. O segmento de Materiais de Engenharia da Empresa inclui o negócio de Materiais de Engenharia e certas afiliadas estratégicas. O negócio de materiais projetados desenvolve, produz e fornece um amplo portfólio de polímeros especiais de alto desempenho para aplicações automotivas e médicas, bem como produtos industriais e eletrônicos de consumo. O segmento de Cadeia de Acetil da Companhia inclui a cadeia integrada de ácido acético, monômero de acetato de vinila (VAM), anidrido acético, ésteres de acetato, polímeros de emulsão, polímeros de acetato de vinilo de etileno (EVA), pós redispersíveis (RDP) e negócios de reboque de acetato. A cadeia de acetil produz e fornece produtos acetil, incluindo ácido acético, VAM, anidrido acético e ésteres de ac', 'Irving, TX, United States', 11000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EB', 'STOCK', 'Eventbrite, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Eventbrite, Inc. is a global events marketplace that serves event creators and event-goers in approximately 180 countries. The Company''s two-sided marketplace connects creators and consumers every month to share their passions, artistry, and causes through live experiences. The Company leverages technology and the Eventbrite brand to engage audiences and connect them in ways that help maximize business opportunities for event creators and satisfy consumer demands. The Company''s self-service ticketing and marketing tools enable creators to plan, promote, and sell tickets to their events. The Company''s Website and mobile application allow event seekers to discover and purchase tickets to experiences they enjoy. Its subsidiaries include Eventbrite UK Limited, Eventbrite International, Inc., Eventbrite Operations (IE) Limited, Eventbrite Singapore Pte. Ltd., Eventioz Holdings, Inc., Eventbrite Hong Kong Limited and Eventbrite Technologies India Private Limited.', 'San Francisco, CA, United States', 748);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASB', 'STOCK', 'Associated Banc-Corp', 'NYQ', 'Financial Services', 'Banks - Regional', 'Associated Banc-Corp is a bank holding company. The Company, through Associated Bank and various nonbanking subsidiaries, provides an array of banking and nonbanking products and services to individuals and businesses through 188 banking branches, serving more than 100 communities, primarily within its three-state branch footprint. The Corporate and Commercial Specialty segment serves a wide range of customers, including larger businesses, developers, not-for-profits, municipalities, and financial institutions by providing lending and deposit solutions as well as the support to deliver, fund, and manage such banking solutions. The Community, Consumer and Business segment serves individuals and businesses by providing lending and deposit solutions and a variety of investment, fiduciary, and retirement planning products and services. The Risk Management and Shared Services segment includes key shared operational functions and also includes residual revenue and expenses.', 'Green Bay, WI, United States', 3993);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPLS', 'STOCK', 'AB Core Plus Bond ETF', 'NGM', NULL, NULL, 'The fund pursues its objective by investing, under normal circumstances, at least 80% of its net assets, including any borrowings for investment purposes, in fixed-income securities. It may invest in a broad range of debt securities, including corporate bonds and debt and mortgage- and other asset-backed securities issued by U.S. government-sponsored entities and federal agencies and instrumentalities that are not backed by the full faith and credit of the U.S. government.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZAI', 'STOCK', 'Blaize Holdings, Inc.', 'NGM', 'Technology', 'Software - Application', 'Blaize Holdings, Inc. is a provider of purpose-built, artificial intelligence (AI)-enabled edge computing solutions. The Company provides a full-stack programmable processor architecture suite and a low-code/no-code software platform that enables AI processing solutions for high-performance computing at the networks edge and in the data center. Its solutions deliver real-time insights and decision-making capabilities. Its products include Blaize Pathfinder, Blaize Xplorer platforms and the Blaize AI Software Suite. It includes Blaize Xplorer X1600E EDSFF Small Form Factor Accelerator, Blaize Xplorer X600M M.2 Small Form Factor Accelerator Platform, Blaize Xplorer X1600P PCIe Accelerator, Blaize Xplorer X1600P-Q PCIe Accelerator, Blaize Pathfinder P1600 Embedded System on Module, and Blaize Pathfinder 1600-DK Embedded Kit. Its AI Studio delivers AI-driven, application end-to-end data operations (DataOps), development operations (DevOps), and Machine Learning operations (MLOps) tools.', 'El Dorado Hills, CA, United States', 232);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIQ', 'STOCK', 'Global X Artificial Intelligence & Technology ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to track the performance of companies involved in the development and utilization of artificial intelligence ("AI") and big data. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNOW', 'STOCK', 'DNOW Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'DNOW Inc. is a supplier of energy and industrial products and packaged, engineered process and production equipment. The Company offers a set of supply chain solutions combined with a suite of digital offerings branded as DigitalNOW that provides customers access to digital commerce, data, and information management channels. It is engaged in providing application systems, work processes, parts integration, optimization solutions and after-sales support that provide productive solutions for its customers. Its product offering includes pipe, manual and automated valves, fittings, flanges, gaskets, fasteners, electrical, instrumentation, artificial lift, pumping solutions and modular process, production, measurement, automation, control equipment, and consumable maintenance, repair and operating (MRO) supplies. It also offers sourcing, procurement, warehouse, and inventory management solutions as part of its supply chain and materials management offering.', 'Houston, TX, United States', 2575);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AISP', 'STOCK', 'Airship AI Holdings, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Airship AI Holdings, Inc. is a technology company. The Company offers an artificial intelligence (AI)-driven video, sensor and data management surveillance platform that improves public safety and operational efficiency for public sector and commercial customers by providing predictive analysis of events before they occur and meaningful intelligence to decision makers. Its product suite includes Outpost AI edge hardware and software offerings, the Acropolis enterprise management software stack, and the Command family of visualization tools. It specializes in ingesting all available metadata from edge-based sensors used by government and law enforcement agencies around the world, including surveillance cameras (video), audio, telemetry, acoustic, seismic, and autonomous devices, along with large commercial corporations with fundamentally similar capabilities and requirements. Its offerings allow customers to manage their data across the full data lifecycle, when and where they need it.', 'Redmond, WA, United States', 55);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANY', 'STOCK', 'Sphere 3D Corp.', 'NCM', 'Financial Services', 'Capital Markets', 'Sphere 3D Corp. is a Canada-based bitcoin mining company. The Company is engaged with Bitcoin mining pool operators, its customers, to provide a service to perform hash calculations for the mining pool operator. It is engaged in digital asset mining operation through the capital-efficient procurement of next generation mining equipment and partnering with data center operators.', 'Stamford, CT, United States', 2);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHKP', 'STOCK', 'Check Point Software Technologies Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'A Check Point Software Technologies Ltd é uma empresa com sede em Israel envolvida principalmente no setor de segurança cibernética. A empresa se concentra no fornecimento de soluções de segurança baseadas em IA e entregues na nuvem para proteger empresas e governos em todo o mundo. Seu principal produto é a Check Point Infinity Architecture, que é uma plataforma abrangente de segurança cibernética. A Plataforma visa defender-se contra ataques cibernéticos de quinta geração em várias redes, endpoints, ambientes de nuvem, cargas de trabalho, Internet das Coisas (IoT) e dispositivos móveis. Além disso, a empresa oferece uma gama de produtos e serviços projetados para proteger a INFRAESTRUTURA DE TI. Ele integra tecnologias avançadas de prevenção de ameaças, incluindo firewall, sistema de prevenção de intrusão (IPS), antivírus, anti-bot e recursos de sandboxing.', 'Tel Aviv, , Israel', 6669);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERAS', 'STOCK', 'Erasca, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Erasca, Inc. is a clinical-stage precision oncology company. The Company is focused on discovering, developing, and commercializing therapies for patients with RAS/MAPK pathway-driven cancers. The Company has assembled RAS/MAPK pathway-focused pipeline in the industry, consisting of modality-agnostic programs aligned with its three therapeutic strategies of: targeting key upstream and downstream signaling nodes in the RAS/MAPK pathway; targeting RAS directly; and targeting escape routes that emerge in response to treatment. Its pipeline includes one clinical-stage program (a pan-RAF inhibitor), two IND-enabling stage programs (a pan-RAS molecular glue and a pan-KRAS inhibitor), and an additional discovery-stage program (an EGFR D2/D3 biparatopic antibody). Its lead product candidate is naporafenib, the Company initiated its SEACRAFT-2 pivotal Phase III trial for patients with NRAS-mutated (NRASm) melanoma.', 'San Diego, CA, United States', 103);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASMG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long ASML Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLCO', 'STOCK', 'Bausch + Lomb Corporation', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Bausch + Lomb Corporation is an eye health company. It operates through three segments: Vision Care, Pharmaceuticals, and Surgical. Vision Care segment includes both a contact lens and a consumer eye care business that consists of contact lens care products, over-the-counter eye drops and eye vitamins. Pharmaceuticals segment consists of generic pharmaceutical products for post-operative treatments and treatments for a number of eye conditions, such as glaucoma, eye inflammation, ocular hypertension, dry eyes and retinal diseases. Surgical segment consists of medical device equipment, consumables, instruments and technologies for the treatment of cataracts, corneal and vitreous and retinal eye conditions, which includes delivery systems, phacoemulsification equipment and other surgical instruments and devices for cataract surgery. Its brands consist of PreserVision, Biotrue, Artelac, Alaway, Mioclear, Ocuvite, ScoutPro, XIIDRA, Vyzulta, Lotemax, Prolensa, Minims, INFUSE, and many more.', 'Vaughan, ON, Canada', 13500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MIST', 'STOCK', 'Milestone Pharmaceuticals Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Milestone Pharmaceuticals Inc. is a Canada-based biopharmaceutical company. The Company is focused on the development and commercialization of cardiovascular medicines. Its lead product candidate, etripamil, is a potent rapid-onset calcium channel blocker that the Company designed and is developing as a rapid-onset nasal spray to be administered by patients. The Company is also focused on developing etripamil to treat paroxysmal supraventricular tachycardia, atrial fibrillation, and other cardiovascular indications.', 'Montreal, QC, Canada', 33);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGEN', 'STOCK', 'Agenus Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Agenus Inc. is a clinical-stage biotechnology company specializing in discovering and developing therapies to activate the body''s immune system against cancer and infections. The Companys pipeline includes immune-modulatory antibodies, adoptive cell therapies (via MiNK Therapeutics, Inc.), and vaccine adjuvants (via SaponiQx, Inc.). Its primary focus is immuno-oncology (I-O), and its diverse pipeline is supported by its in-house capabilities, including current good manufacturing practice (cGMP) manufacturing and a clinical operations platform. Its most advanced antibody candidates are botensilimab (a multifunctional immune cell activator and human Fc-enhanced cytotoxic T-lymphocyte antigen 4 (CTLA-4) blocking antibody) and balstilimab (a novel, fully human monoclonal immunoglobulin G4 (IgG4) PD-1 inhibitor). Its pipeline includes several classes of immunotherapies: checkpoint inhibitors, immune activators, and tumor microenvironment conditioning agents.', 'Lexington, MA, United States', 316);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBLG', 'STOCK', 'FibroBiologics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'FibroBiologics, Inc. is a clinical-stage biotechnology company. The Company is focused on developing and commercializing fibroblast-based therapies for patients suffering from chronic diseases with significant unmet medical needs, including wound healing, multiple sclerosis, degenerative disc disease, psoriasis and certain cancers, and potential human longevity applications including thymic involution reversal. Its product candidates include CybroCell, CYMS101 and CYWC628. CybroCell is an allogeneic fibroblast cell-based therapy for degenerative disc disease. This technology is being designed as an alternative method for repairing the cartilage of the intervertebral disc (or any other articular cartilage). It is developing CYMS101 as an allogeneic fibroblast cell-based therapy to treat multiple sclerosis (MS) and has completed the Phase I study. It is developing CYWC628 as an allogeneic fibroblast cell-based therapy for wound healing. Its CYPS317 is used for the treatment of Psoriasis.', 'Houston, TX, United States', 13);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXPD', 'STOCK', 'Expeditors International of Washington, Inc.', 'NYQ', 'Industrials', 'Integrated Freight & Logistics', 'A Expeditors International of Washington, Inc. É uma empresa global de logística. Os serviços da Companhia incluem consolidação ou encaminhamento de frete aéreo e marítimo, corretagem alfandegária, consolidação de fornecedores, seguro de carga, transporte com prazo definido, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias e transporte de mercadorias. gestão de pedidos, armazenagem e distribuição e soluções logísticas personalizadas. Os principais serviços da Companhia incluem serviços de frete aéreo, serviços de frete marítimo e marítimo, corretagem aduaneira e outros serviços. Oferece um conjunto completo de serviços globais de logística, oferecendo aos clientes acesso a uma rede internacional de pessoas e sistemas de informação integrados para apoiar o movimento e posicionamento estratégico de mercadorias. Como fornecedor de logística terceirizado, compra espaço de carga de transportadoras em uma ba', 'Bellevue, WA, United States', 19666);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DD', 'STOCK', 'DuPont de Nemours, Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A DuPont de Nemours, Inc. Fornece materiais e soluções baseados em tecnologia. Seu segmento de Eletrônica e Industrial é um fornecedor global de materiais e sistemas diferenciados para uma gama de eletrônicos de consumo, incluindo dispositivos móveis, monitores de televisão, computadores pessoais e eletrônicos usados em uma variedade de indústrias. O segmento fornece materiais e soluções para a fabricação e embalagem de semicondutores e circuitos integrados e fornece soluções para gestão térmica e processos de blindagem eletromagnética e metalização para aplicações de acabamento metálico, decorativo e industrial. O seu segmento de Água e Proteção fornece produtos de engenharia e sistemas integrados para uma série de indústrias, incluindo segurança dos trabalhadores, purificação e separação de água, aeroespacial, energia, embalagens médicas e materiais de construção. Suas marcas incluem NOMEX, KEVLAR, TYVEK, FILMTEC, AMBERLITE, e ISOPOR. Ele também oferece capacidades avançadas de fabri', 'Wilmington, DE, United States', 24000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELS', 'STOCK', 'Equity LifeStyle Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Residential', 'A Equity lifestyle Properties, Inc. É uma confiança de investimento imobiliário auto-administrada e auto-gerida (REIT). A empresa é proprietária totalmente integrada de propriedades orientadas para o estilo de vida, que consistem em operações de propriedade e vendas e operações de locação em casas manufaturadas (MH) e veículos recreativos (RV) comunidades e marinas. Atua através de dois segmentos: Operações de Propriedade e Operações de Vendas e Aluguel de Casas. O segmento de Operações de Propriedade possui e opera Propriedades arrendadas por terra. O segmento Home Sales and Rentals Operations compra, vende e aluga casas nas Propriedades. Seu portfólio é geograficamente diversificado em locais desejáveis perto de destinos de aposentadoria e férias e áreas urbanas em todos os Estados Unidos. Possui um interesse em um portfólio de aproximadamente 452 propriedades localizadas em todos os Estados Unidos e Canadá, contendo 173 201 áreas desenvolvidas individualmente (sites). Estas propried', 'Chicago, IL, United States', 3800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CERT', 'STOCK', 'Certara, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'Certara, Inc. is a provider of biosimulation technology and solutions for using Model-Informed Drug Development (MIDD) in the global biopharmaceutical industry. It accelerates medicine using biosimulation software, technology and services to transform traditional drug discovery and development. It delivers software products and technology-driven services to customers to carry out and realize the full benefits of biosimulation in drug discovery, preclinical and clinical research, regulatory submissions and market access. Its regulatory science and market access software and services, such as regulatory submissions software, natural language processing and Bayesian analytics. It offers both mechanistic and empirical biosimulation solutions providing clients with a comprehensive offering based on their therapy goals, mechanism of action, and available data sources. Its clients include 2,400 biopharmaceutical companies, academic institutions and regulatory agencies across 70 countries.', 'Radnor, PA, United States', 1487);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AROC', 'STOCK', 'Archrock, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Archrock, Inc. is an energy infrastructure company with a primary focus on midstream natural gas compression. The Company is a provider of natural gas compression services to customers in the energy industry throughout the United States. It is a supplier of aftermarket services to customers that own compression equipment. Its segments include Contract Operations and Aftermarket Services. The Contract Operations business is comprised of its owned fleet of natural gas compression equipment that it uses to provide operations services to its customers. The aftermarket services business provides a full range of services to support the compression needs of its customers that own compression equipment, including operations, maintenance, overhaul and reconfiguration services and sales of parts and components. The Company provides comprehensive contract operations services, such as personnel, equipment, tools, materials and supplies to meet its customers natural gas compression needs.', 'Houston, TX, United States', 1300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECC', 'STOCK', 'Eagle Point Credit Company Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Eagle Point Credit Company Inc. is a closed ended fund launched and managed by Eagle Point Credit Management LLC. It invests in fixed income markets of the United States. The fund invests equity and junior debt tranches of collateralized loan obligations consisting primarily of below investment grade U.S. senior secured loans. Eagle Point Credit Company Inc. was formed on March 24, 2014 and is domiciled in the United States.', 'Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAWN', 'STOCK', 'Day One Biopharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Day One Biopharmaceuticals, Inc. is a commercial-stage biopharmaceutical company focused on developing and commercializing targeted therapies for people of all ages with life-threatening diseases. The Company partners with clinical oncologists, families, and scientists to identify, acquire, and develop cancer treatments. The Companys commercial product, OJEMDA (tovorafenib), is an oral, brain-penetrant, selective type II rapidly accelerated fibrosarcoma (RAF) kinase inhibitor of mutant BRAF V600, wild-type BRAF, and wild-type CRAF kinases. Its pipeline product candidates include DAY301 and VRK1 program. The DAY301 candidate is a PTK7 targeted ADC composed of a novel humanized anti-PTK7 immunoglobulin G1 monoclonal antibody (mAb), conjugated with a topoisomerase I inhibitor through a stable and hydrophilic modified valine-alanine (VA) cleavable linker. Its VRK1 program is a novel target involved in the regulation of cell division and DNA damage repair.', 'Brisbane, CA, United States', 182);\n
